import React, { useState } from "react";
import Categories from "./components/Categories/FormCategories.js";
import Products from "./components/Products/Products.js";


function App() {
  const [isPropsSearch, setPropSearch] = useState({});

  const handlerSearch = (event) => {
    setPropSearch(event);
  };

  return (
    <div className="App">
      <Categories onSearch={handlerSearch}></Categories>
      <Products props={isPropsSearch} ></Products>
    </div>
  );
}

export default App;
